import React from 'react';
import profileIcon from "./profile-icon.jpg";

export const Portfolio = () => {
	return (
		<>
			<div className="header">
				<img src={profileIcon} className="profile-icon" alt="Whoops..." />
				<div>
					<p className="text-large no-margin">Ryan Caudill</p>
					<p className="text-medium no-margin">I am a full-stack software developer at Reynolds and Reynolds.</p>
				</div>
			</div>
		</>
	);
}
